import React, { Fragment } from 'react'
import Header from '../Header/Header';
import Footer from '../Footer/Footer';
import Routers from '../../routers/Routers'

const LayOut = () => {
  return (
      <Fragment>
          <Header />
          <div>
              <Routers/>
          </div>
          <Footer/>
     </Fragment>
  )
}
export default LayOut;
